module.exports = "<!-- <!doctype html> -->\n<!-- <html class=\"no-js no-svg\"> -->\n<!-- <head>\n    <meta charset='UTF-8'>\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"msapplication-TileColor\" content=\"#ffffff\">\n    <meta name=\"theme-color\" content=\"#ffffff\">\n    <meta name=\"theme-color\" content=\"#000\">\n    <meta name=\"msapplication-navbutton-color\" content=\"#000\">\n    <meta name=\"apple-mobile-web-app-status-bar-style\" content=\"#000\">\n    <link rel=\"stylesheet\" href=\"css/main.min.css\">\n</head> -->\n<div class=\"privacy-policy\">\n    <div class=\"wrapper\" id=\"pageWrap\">\n        <div class=\"header\">\n            <div class=\"cn\">\n                <div class=\"header-logo\">\n                    <img src=\"../../assets/img/LOGOvector-file.svg\" alt=\"Shidduch View\">\n                </div>\n            </div>\n        </div>\n        <main class=\"main\">\n            <div class=\"cn privacy-policy__content\">\n                <h1 class=\"h1\">PRIVACY POLICY\n                    <br> EFFECTIVE DATE: 09/14/19</h1>\n                <h2 class=\"h2\">1. INTRODUCTION</h2>\n                <p>These Privacy Policy govern the processing of personal data through the ShidduchView (the “Application”)\n                    and the website located at https://theaishadchan.com (the “Website”, collectively referred to as “Products”),\n                    operated by Shidduch ViewLLC (“us”, “its”, “ours”, “we”), company registered under the laws of the State\n                    of Michigan. </p>\n                <p>Please read this Policy carefully before using our Products. </p>\n                <p>This Policy may be updated from time to time and in this case, we will notify you about this.</p>\n                <p>This Policy shall be supplemented by our Terms of Use, and any other guidelines, .terms and policies made\n                    available by us from time to time, incorporated herein by reference. </p>\n                <p>Any terms used in this Privacy Policy shall have the meaning defined inthe Terms of Use BY USING THE APP,\n                    WEBSITE OR SERVICE, YOU CONFIRM AND ASSERT THAT </p>\n                <p>(A) YOU HAVE READ, UNDERSTAND AND AGREE TO THIS PRIVACY POLICY ANDPROCESSING OF PERSONAL DATA PURSUANT TO\n                    THIS POLICY, AND </p>\n                <p>(B) YOUR USE OF ANY OF AFORE SAID SHALL COMPLY WITH REQUIREMENTS OF THE TERMS OF SERVICE.</p>\n\n                <h2 class=\"h2\">1. DEFINITIONS</h2>\n                <p>\n                    <b>A.</b>\n                    <strong>“Personal Data”</strong> means is any data that could potentially be used to identify a particular natural\n                    person.\n                </p>\n                <p>\n                    <b>B.</b>\n                    <strong>“GDPR”</strong> means the General Data Protection Regulation (EU) 2016/679 of the European Parliament\n                    and of the Council of 27 April 2016 on the protection of natural persons with regard to the processing\n                    of personal data and on the free movement of such data.</p>\n                <p>\n                    <b>C.</b>\n                    <strong>“EEA”</strong> means all current member states to the European Union and the European Economic Area.</p>\n                <p>\n                    <b>D.</b>\n                    <strong>“Process”</strong> or\n                    <strong>“Processing”</strong>, in respect of Personal data, means collection, storage, and disclose to third\n                    parties.\n                </p>\n\n                <h2 class=\"h2\">2. GENERAL</h2>\n                <p>\n                    <b>A.</b> Shidduch View acknowledge and understand your privacy and makes efforts to protect it against\n                    any unlawful Processing of your Personal Data. </p>\n                <p>\n                    <b>B.</b> We apply all necessary relevant technical and organizational measures to protect your Personal\n                    Data in accordance with the effective legislation. We use industry standard protocols and technology\n                    to protect your registered user information and PI, such as Secure Socket Layer (SSL) technology and\n                    secure databases. Your Personal Data is only accessible by a limited number of our employees who have\n                    special access rights. Overall, we implement and maintain reasonable security measures to protect our\n                    databases and records from unauthorized access, acquisition, destruction, use or disclosure.</p>\n                <p>\n                    <b>C.</b> The Personal Data processing is carried out using computers and/or IT enabled tools, following\n                    organizational procedures and modes strictly related to the purposes indicated.</p>\n                <p>\n                    <b>D.</b> We apply the following principles in order to protect your privacy: </p>\n                <ul>\n                    <li>(a) we will not sell or lease your Personal Data to third parties; </li>\n                    <li>(b) any Personal Data that you provide to us will be secured with industry standard safety protocols\n                        and technology</li>\n                </ul>\n                <p>\n                    <b>E.</b> Although we will take diligent efforts to ensure safe storage and processing of Personal Data,\n                    we cannot guarantee it to be 100% secure and risk-free. Unauthorized entry or use, hardware or software\n                    failure, force majeure and other factors, may compromise the security of your information at any time.</p>\n\n\n                <h2 class=\"h2\">3. PERSONAL DATA WE COLLECT</h2>\n                <p>\n                    <b>A.</b>\n                    <strong> Data provided by User.</strong> When you sign up for any of our account options,you will need to provide\n                    your name, surname, gender, age, email address, phonenumber, among other information.</p>\n                <p>\n                    <b>B.</b>\n                    <strong> Data provided by third parties.</strong> When you create an account with using third-party service (Facebook\n                    or Google) we get Personal Data from your respective social media accounts. This includes your social\n                    media data, Facebook ID, GoogleID. For more information, please refer to the policies of third social\n                    media services chosen for login.</p>\n                <p>\n                    <b>C.</b>\n                    <strong> Device data.</strong> We collects data from your mobile device. Examples of such data include device\n                    settings, model of a device, hardware ID, operating system.</p>\n                <!-- <p><b>D.</b> <strong> Subscription.</strong> -->\n\n                <h2 class=\"h2\">4. PURPOSE OF PROCESSING</h2>\n                <p>\n                    <b>A.</b>\n                    <strong> Provision of Service.</strong> We collect Personal Data to provide Service to its User’s. It includes\n                    enabling User to use the Service in a seamless manner and preventing or addressing Service errors or\n                    technical issues. </p>\n                <p>\n                    <b>B.</b>\n                    <strong> Communication.</strong> We may communicate with you by sending push notifications or emails. You may\n                    opt out of receiving push notifications by changing the settings on the mobile device. </p>\n                <p>\n                    <b>C.</b>\n                    <strong> Management of accounts and technical support.</strong> We Process Personal Data to respond to your requests\n                    and messages.</p>\n                <p>\n                    <b>D.</b>\n                    <strong> Terms enforcement. </strong> We use Personal Data to enforce agreements and contractual commitments,\n                    to detect, prevent, and combat fraud. For this purpose we may share your information with attorneys,\n                    lawyers, law enforcement agenciesand organs.</p>\n                <p>\n                    <b>E.</b>\n                    <strong> To comply with legal obligations</strong> We may Process, use, or share your data when the law requires\n                    us to do so, in particular, if a law enforcement agency requests particular User’s data by available\n                    legal means.</p>\n\n                <h2 class=\"h2\">5. STORAGE</h2>\n                <p>\n                    <b>A.</b> As our user, you will generally be able to control and select the amount and type of Personal\n                    Data you may disclose to us. We endeavor to improve our user experience, and strive to provide you the\n                    best choices for the disclosure, edition or removal of the Personal Data being processed by us. Accordingly,\n                    we will undertake the open and transparent management of your Personal Data and will: (i) inform you\n                    about how your personal information may be used and disclosed (including overseas); (ii) maintain the\n                    safety and integrity of your personal information; and/or (iii) enforce your individual right to access\n                    and correct your personal information.</p>\n                <p>\n                    <b>B.</b> We take technical, organizational and legal measures, including, where suitable, encryption, to\n                    ensure that Personal Data is protected from unauthorized or accidental access, deletion, modification,\n                    blocking, copying and dissemination.</p>\n\n                <h2 class=\"h2\">6. LEGAL BASIS FOR PROCESSING (INFORMATION FOR EEA BASED USER)</h2>\n                <p>This section explains what legal basis we use for each particular purpose of processing. For more information\n                    on a particular purpose, please refer to Section 4 of this Privacy policy. This section applies only\n                    to EEA-based Users. We process EEA-based User’s Personally identifiable data under the following legal\n                    bases:\n                </p>\n                <p>\n                    <b>A.To perform our contract with users. Under this legal basis we:</b>\n                </p>\n                <p>- provide services embodied (in accordance with the Terms of Use);</p>\n                <p>- manage users accounts and provide users with customer support; </p>\n                <p>- communicate with users regarding use of Application;</p>\n                <p>\n                    <b>B. For other legitimate interests, unless those interests are overridden by user’s interests or fundamental\n                        rights and freedoms that require protection of personal data; We rely on legitimate interests:</b>\n                </p>\n                <p>- to communicate with you regarding your use of Application. This includes, for example, sending push notifications.\n                    Our legitimate interest here is interest to encourage user to use Service more often. We also takes into\n                    account the potential benefits to you of using Application;</p>\n                <p>- to research and analyse your use of the Application. The legitimate interest for this purpose is interest\n                    in improving Application so that we understand users preferences and able to provide user with a better\n                    experience;\n                </p>\n                <p>- to send marketing communications The legitimate interest we rely on for this processing is interest to\n                    promote Application in a measured and appropriate way;</p>\n                <p>- to enforce Terms of Use and to prevent and combat fraud. The legitimate interests for this purpose are\n                    enforcing our legal rights, preventing and addressing fraud and unauthorized use of Application, non-compliance\n                    withour Terms of Use;</p>\n                <p>- to comply with legal obligations.</p>\n\n                <h2 class=\"h2\">7. EEA-based user rights</h2>\n                <p>Users who are based in the EEA have the following rights in addition to the above:</p>\n                <p>\n                    <b>A.</b>\n                    <strong>Right to rectification.</strong> User has the right to request to rectify, without undue delay, any incorrect\n                    data pertaining to the respective User.</p>\n                <p>\n                    <b>B.</b>\n                    <strong>Right to limitation of processing.</strong> User can limit the use of Personally Data collected.</p>\n                <p>\n                    <b>C.</b>\n                    <strong>Right of access.</strong> User may request a copy of Personal Data collected during use of Application\n                    at support@shidduchview.com.</p>\n                <p>\n                    <b>D.</b>\n                    <strong>Objecting to or restricting the use of Personal Data.</strong> User can ask to stop using all or some\n                    portion of Personal Data or limit use thereof by requesting its erasure as described above or sending\n                    a request at support@shidduchview.com</p>\n                <p>\n                    <b>E.</b>\n                    <strong>The right to lodge a complaint with supervisory authority.</strong> User has the right to lodge a complaint\n                    with a competent data protection supervisory authority, in particular in the EU Member State where user\n                    resides, work or where the alleged infringement has taken place.</p>\n                <p>\n                    <b>F.</b>\n                    <strong>The right to data portability.</strong> User can receive Personal Data in a machine-readable format by\n                    sending respective request at support@shidduchview.com</p>\n\n                <h2 class=\"h2\">8. EXERCISE OF EEA-BASED USER RIGHTS</h2>\n                <p>To exercise your right to access you have a right to request from us at any time:</p>\n                <p>\n                    <b>A.</b> Confirmation as to whether Personal Data related to you processed by us, purpose of the Processing,\n                    the data category and recipients of such data or the categories of recipients’ data is disclosed to.</p>\n                <p>\n                    <b>B.</b> Information as to the logic of any automated processing of Personal Data pertaining to natural\n                    persons, at least in the case of automated decisions under the provisions of the GDPR.</p>\n                <p>\n                    <b>C.</b> Upon request we provide information free of charge. However, we may charge a reasonable fee if\n                    request is clearly unfounded, repetitive or excessive. Alternatively, we may refuse to comply with your\n                    request in these circumstances.</p>\n                <p>\n                    <b>D.</b> Upon filing of a request by an authorized person, the notarized power of attorney must be attached\n                    to the request.</p>\n                <p>\n                    <b>E.</b> In case of death of the natural person, his / her rights are exercised by his / her heirs and\n                    the certificate of heirs shall be attached to the request. The heritage should be confirmed by respective\n                    certificate, issued in the deceased person’s jurisdiction.</p>\n                <p>\n                    <b>F.</b> We shall review and pronounce on the request within 1 month as of its filing. This period may\n                    be extended by further two months, if necessary, for example, if your request is particularly complex\n                    or you have made a number of requests. We shall inform you as to any such extension within 1 month as\n                    of receipt of the request, stating the reasons for the delay. When you file a request by electronic means,\n                    the information is provided electronically, if possible, unless the you have requested otherwise.</p>\n                <p>\n                    <b>G.</b> We may provide an answer to the requesting person taking into account their preferred form for\n                    the provision of the information (orally or in writing - as a hard copy or electronically).</p>\n                <p>\n                    <b>H.</b> Where data do not exist or their provision is forbidden by law, access of the requesting party\n                    to such data is refused.</p>\n                <p>\n                    <b>I.</b> You are not satisfied with the response received and / or believes that your rights related to\n                    Personal Data protection were violated, you are entitled to exercise your right to defence.</p>\n\n                <h2 class=\"h2\">9. DISCLOSURE OF PERSONAL DATA</h2>\n                <p>We may disclose Personal Data to the following categories of persons:</p>\n                <table>\n                    <tr>\n                        <td>Service providers</td>\n                        <td>Acting as processor or controller based in the EEA but also around the world who provide - services\n                            and IT and system administration services.\n                            <br>\n                            <b>a.</b> Managing contacts and sending messages\n                            <br>\n                            <b>b.</b> Hosting and back-end infrastructure\n                        </td>\n                    </tr>\n                    <tr>\n                        <td>Professional advisors</td>\n                        <td>Acting as a processor or joint controllers including lawyers, bankers, auditors and insurers based\n                            in Estonia who provide consultancy, banking, legal, insurance, and accounting services. </td>\n                    </tr>\n                    <tr>\n                        <td>HM Revenue & Customs, regulators and other authorities</td>\n                        <td>Acting as a processor or joint controllers based in the EEA who require reporting of Processing activities\n                            in certain circumstances</td>\n                    </tr>\n                    <tr>\n                        <td>Third parties</td>\n                        <td>Third parties to whom we may choose to sell, transfer, or merge parts of business or assets.</td>\n                    </tr>\n                </table>\n\n                <h2 class=\"h2\">10. PLACE</h2>\n                <p>\n                    <b>A.</b> Personal Data is processed at our operating offices and in any other places where the parties\n                    involved in the processing are located. Depending on your location, data transfers may involve transferring\n                    of your Personal Data to a country or state other than your own.</p>\n                <p>\n                    <b>B.</b> You are also entitled to learn about the legal basis of data transfers to a country outside the\n                    European Union or to any international organization governed by public international law or set up by\n                    two or more countries, such as the UN, andabout the security measures taken by us to safeguard your.</p>\n\n                <h2 class=\"h2\">11. RETENTION TIME</h2>\n                <p>\n                    <b>A.</b> Personal Data shall be processed and stored for as long as required by the purpose they have been\n                    collected for, but not more than 5 years.</p>\n                <p>\n                    <b>B.</b> Personal Data collected for purposes related to the performance of a contract between you and\n                    us shall be retained until such contract has been fully performed.</p>\n                <p>\n                    <b>C.</b> Personal Data collected for the purposes of our legitimate interests shall be retained as long\n                    as needed to fulfill such purposes. You may find specific information regarding the legitimate interests\n                    in this Privacy Policy.</p>\n                <p>\n                    <b>D.</b> Once the retention period expires, your Personal Data shall be deleted. Therefore, the right to\n                    access, the right to erasure, the right to rectification and theright to data portability cannot be enforced\n                    after expiration of the retention period.</p>\n\n                <h2 class=\"h2\">12. AGE LIMITATION</h2>\n                <p>We do not knowingly Process any Personal Data from persons under 18 years of age. If you learn that anyone\n                    younger than 18 has provided us with Personal Data, please contact us at\n                    <b>support@shidduchview.com.</b>\n                </p>\n\n                <h2 class=\"h2\">13. HOW TO CONTACT US</h2>\n                <p>If you have any questions or queries about us, our platform, products and services, our Terms and/or this\n                    Policy, please contact us as indicated in our app and websites.</p>\n\n                <h2 class=\"h2\">14. “DO NOT TRACK” REQUEST</h2>\n                <p>Our Application does not support “Do Not Track” requests. To determine whether any of the third-party services\n                    it uses honor the “Do Not Track” requests, please read their privacy policies.</p>\n\n                <h2 class=\"h2\">15. PERMISSIONS REQUIRED</h2>\n                <p>Our Application require permissions : INTERNET, ACCESS_NETWORK_STATE, BILLING, WAKE_LOCK, CAMERA, RECORD_AUDIO,\n                    MODIFY_AUDIO_SETTINGS in order to the application be functioning</p>\n                <h2 class=\"h2\">16. EXTERNAL URL USAGE</h2>\n                <p> Our Application use YouTube video links and player for entertainment purpose and also to know about our appliction.</p>\n                <h2 class=\"h2\">17. SUBSCRIPTION</h2>\n             \n                <b>Trials</b>\n            \n                    From time to time, we or others on our behalf may offer trials of Paid Subscriptions for a specified period without payment\n                    or at a reduced rate (a “Trial”). We may determine your eligibility for a Trial, and withdraw or modify\n                    a Trial at any time without prior notice and with no liability, to the extent permitted under applicable\n                    law. For some Trials, we’ll require you to provide your payment details to start the Trial. By providing\n                    such details you agree that we may automatically begin charging you for the Paid Subscription on the\n                    first day following the end of the Trial on a recurring monthly basis or another interval that we disclose\n                    to you in advance. IF YOU DO NOT WANT THIS CHARGE, YOU MUST CANCEL THE APPLICABLE PAID SUBSCRIPTION BEFORE\n                    THE END OF THE TRIAL BY\n                    <b> For android: </b>\n\n                    <p>a. On your Android phone or tablet, open the Google Play Store . </p>\n                    <p>b. Check if you're signed in to the correct Google Account.</p>\n                    <p>c. Tap Menu. Subscriptions.</p>\n                    <p>d. Select the Shidduch View app to cancel.</p>\n                    <p>e. Tap Cancel subscription.</p>\n                    <p>Click here https://play.google.com/store/account/subscriptions</p>\n\n                    <b>For iOS </b>\n                    <p>a. Go to Settings > [your name] > iTunes and App Store.</p>\n                    <p>b. Tap on your Apple ID at the top of the screen.</p>\n                    <p>c. Tap View Apple ID and sign in if prompted.</p>\n                    <p>d. Scroll down and tap on Subscriptions.</p>\n                    <p>e. Find the subscription and tap on it.</p>\n                    <p>f. Tap Cancel Subscription at the bottom.</p>\n                    <p>g. You’ll get a pop-up telling you when the subscription will expire if you cancel and you can tap Confirm\n                        to complete the cancellation.</p>\n                    <p>IF YOU SIGNED UP FOR THE TRIAL THROUGH SHIDDUCH VIEW OR IF YOU RECEIVED YOUR TRIAL THROUGH A THIRD PARTY,\n                        YOU MUST CANCEL THE APPLICABLE PAID SUBSCRIPTION THROUGH THE THIRD PARTY.</p>\n                \n                <b>Payments and Cancellations</b>\n                <p>\n                    4.1 Billing You may purchase a Paid Subscription directly from Shidduch View or through a third party either by (1) paying\n                    a subscription fee in advance on a monthly basis or some other recurring interval disclosed to you prior\n                    to your purchase; or (2) pre-payment giving you access to Shidduch View for a specific time period (“Pre-Paid\n                    Period”). Shidduch View may change the price for the Paid Subscriptions, including recurring subscription\n                    fees, the Pre-Paid Period (for periods not yet paid), or Codes, from time to time and will communicate\n                    any price changes to you in advance and, if applicable, how to accept those changes. Price changes will\n                    take effect at the start of the next subscription period following the date of the price change. Subject\n                    to applicable law, you accept the new price by continuing to use the Shidduch View Service after the\n                    price change takes effect. If you do not agree with a price change, you have the right to reject the\n                    change by unsubscribing from the Paid Subscription prior to the price change going into effect.\n                </p>\n                \n                    <b>Renewal; Cancellation</b>\n                    <p>\n                        Unless your Paid Subscription has been purchased for a Pre-Paid Period, your payment to Shidduch View or the third party\n                        through which you purchased the Paid Subscription will automatically renew at the end of the applicable\n                        subscription period, unless you cancel your Paid Subscription before the end of the then-current\n                        subscription period by doing the following steps\n                    </p>\n                    <b> For android: </b>\n\n                    <p>a. On your Android phone or tablet, open the Google Play Store . </p>\n                    <p>b. Check if you're signed in to the correct Google Account.</p>\n                    <p>c. Tap Menu. Subscriptions.</p>\n                    <p>d. Select the Shidduch View app to cancel.</p>\n                    <p>e. Tap Cancel subscription.</p>\n                    <p>Click here https://play.google.com/store/account/subscriptions</p>\n\n                    <b>For iOS </b>\n                    <p>a. Go to Settings > [your name] > iTunes & App Store.</p>\n                    <p>b. Tap on your Apple ID at the top of the screen.</p>\n\n                    <p>c. Tap View Apple ID and sign in if prompted.</p>\n                    <p>d. Scroll down and tap on Subscriptions.</p>\n                    <p>e. Find the subscription and tap on it.</p>\n                    <p>f. Tap Cancel Subscription at the bottom.</p>\n                    <p>g. You’ll get a pop-up telling you when the subscription will expire if you cancel and you can tap Confirm\n                        to complete the cancellation.</p>\n                    <p>IF YOU SIGNED UP FOR THE TRIAL THROUGH SHIDDUCH VIEW OR IF YOU RECEIVED YOUR TRIAL THROUGH A THIRD PARTY,\n                        YOU MUST CANCEL THE APPLICABLE PAID SUBSCRIPTION THROUGH THE THIRD PARTY.</p>\n                    <p>\n                        If you purchased the Paid Subscription through Shidduch View, or if you purchased the Paid Subscription through a third party,\n                        by canceling the Paid Subscription through such third party. The cancellation will take effect the\n                        day after the last day of the current subscription period, and you will be downgraded to the Free\n                        Service. We do not provide refunds or credits for any partial subscription periods. If you have purchased\n                        a Paid Subscription using a Code, your subscription will automatically terminate at the end of the\n                        period stated in the Code, or when there is an insufficient pre-paid balance to pay for the Service.\n                        If you have purchased your Paid Subscription through a third party, you must cancel directly with\n                        that third party.\n                    </p>\n                \n            </div>\n        </main>\n    </div>\n</div>\n<!-- </html> -->"

